function parseData(data) {
  if (data) {
    if (typeof data === 'string') {
      return JSON.parse(data);
    } else {
      return data;
    }
  }
  return null;
}

getErrorMessage.code:
function getErrorMessage(body) {
	if(body) {
		if (body.meta) {
			if (body.meta.errors) {
				return iml.capitalize(body.meta.errors.join(', '));

			} else if (body.meta.error) {
				return iml.capitalize(body.meta.error);
			}

		} else if (body.errors) {
			return iml.capitalize(body.errors.map(e => e.detail || e).join(', '));
		}

		return iml.capitalize(body.error || 'Unknown error.');
	}
	return 'Unknown error - no body returned.';
}

